import {FETCH} from '../ActionTypes/tablelist'


const initial = {
    data : ""
};



export const  tablelistReducer = (state = initial, action ) => {
    switch (action.type) {
         case FETCH: {
             return {
                 ...state,
                 data: action.payload
             };
         }
    }
}
